import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions";

import service from '../../helpers/services'

const getChoferes = () =>{
      return dispatch =>{
          service.get("/choferes/").then((res)=>
           dispach(loadChofers(res))
          )
      }
}

export default {getChoferes}
